import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Home from './routes/Home';
import CompanyDetails from './routes/CompanyDetails';
import CompanyUpdate from './routes/CompanyUpdate';
import { CompanyContextProvider } from './context/CompanyContext';

const App = () => {
  return (

    <CompanyContextProvider>

    <div className='container'>
        <BrowserRouter>
            <Routes>
                <Route path="/" element={<Home />} />
                <Route path="/compan/:companyId" element={<CompanyDetails />} />
                <Route path="/companies/:companyId/update" element={<CompanyUpdate />} />
            </Routes>
        </BrowserRouter>
    </div>

    </CompanyContextProvider>
  );
};

export default App;
